    name: Kat Golik
    email: karolina.golik@cmha.bc.ca
    body: "Hello there, \r\n\r\nI am contacting you today on behalf of the Canadian
      Mental Health Association BC to inquire about your peer programs and positions.
      My colleagues and I are researching peer employment within BC’s mental health
      and substance use sector. The first phase of our project is mapping where peers
      are currently employed and what jobs they hold. \r\n\r\nWe would very much appreciate
      if you could answer a few, brief questions. \r\n\r\n1.\tDo you employ peers
      or people with lived or living experience of MHSU?\r\n2.\tIf yes, what are their
      job titles?\r\n3.\tDo you offer specific programs that are led or facilitated
      by peers?\r\n4.\tIf yes, can you describe the program? Who are the program participants?\r\n5.\tHow
      are your peer programs and positions funded?\r\n6.\tWho should I contact for
      more information?\r\n\r\nIf you prefer to communicate this information over
      the phone, I can give you a call anytime Tuesday or Thursday afternoon. Please
      let me know when is convenient and what the best number is to reach you. \r\n\r\nWe
      sincerely appreciate your support with this project. The information we collect
      will be used to inform further research, with the goal of promoting and improving
      working conditions for peers across the province.\r\n\r\nI look forward to hearing
      from you. \r\n\r\nBest, \r\nKat Golik Peer Researcher for CMHA"
